sys_variable_value.value:
(function execute(inputs, outputs) {
	var grImp = new GlideRecord("scheduled_import_set");
	if(grImp.get(inputs.schedule_sys_id))
    { 
      gs.executeNow(grImp);
      outputs.error = false;
	} else {
      outputs.error = true;
    }
})(inputs, outputs);

